import { configureStore } from '@reduxjs/toolkit'
import postsReducer from '../features/postsSlice'
import usersReducer from '../components'

export default configureStore({
  reducer: {
    posts: postsReducer,
    users: usersReducer
    //users: usersRre voorbeeld
  }
})
